function dzdt = modelODE(t, z, burrowPos, rabbitSpeed, foxSpeed, warehouseNW, warehouseSW)  Y = 2; # index of y in pos  X = 1; # index of x in pos    % z = [Rx, Ry, Fx, Fy]  % Converted into row vectors to match input parameters  rabbitPos = z(1:2)';  foxPos = z(3:4)'      dzdt = zeros(size(z));  rabbitVelocity = computeVelocity(rabbitSpeed, rabbitPos, burrowPos)';   dzdt(1:2) = rabbitVelocity;  % fox aims for the rabbit  foxTarget = computeFoxTarget(rabbitPos, foxPos, warehouseNW, warehouseSW);    dzdt(3:4) = computeVelocity(foxSpeed, foxPos, foxTarget)';  
endfunction